import { Injectable } from '@angular/core';
import { Workbook } from "exceljs";
import * as fs from "file-saver";

@Injectable({
  providedIn: 'root'
})
export class ExportExcelService {
  constructor() { }
  async generateExcel(excelData) {
    const header = excelData.headers;
    const data = excelData.data;
    const workbook = new Workbook();
    const worksheet = workbook.addWorksheet("Upload ICCID");
    const headerRow = worksheet.addRow(header);
    headerRow.eachCell((cell, number) => {
      cell.fill = {
        type: "pattern",
        pattern: "solid",
        fgColor: { argb: "FFFFFF00" },
        bgColor: { argb: "FF0000FF" },
      };
      cell.border = {
        top: { style: "thin" },
        left: { style: "thin" },
        bottom: { style: "thin" },
        right: { style: "thin" },
      };
    });

    data.forEach((d) => {
      const row = worksheet.addRow(d);
    });

    worksheet.getColumn(1).width = 25;
    worksheet.getColumn(2).width = 20;
    worksheet.getColumn(3).width = 20;
    worksheet.getColumn(4).width = 20;
    worksheet.getColumn(5).width = 25;
    worksheet.getColumn(6).width = 20;
    worksheet.getColumn(7).width = 20;
    worksheet.getColumn(8).width = 20;
    worksheet.addRow([]);
    workbook.xlsx.writeBuffer().then((data: any) => {
      const blob = new Blob([data], {
        type: "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet",
      });
      fs.saveAs(blob, "Iccid.xlsx");
    });
  }
  exportExcel(excelData) {
    //Title, Header & Data
    var title = excelData.title;
    const header = excelData.headers;
    const data = excelData.data;

    //Create a workbook with a worksheet
    let workbook = new Workbook();
    let worksheet = workbook.addWorksheet(title);

    //Add Row and formatting
    worksheet.mergeCells("C1", "F4");
    let titleRow = worksheet.getCell("C1");
    titleRow.value = title;
    titleRow.font = {
      name: "Calibri",
      size: 16,
      underline: "single",
      bold: true,
      color: { argb: "0085A3" },
    };
    titleRow.alignment = { vertical: "middle", horizontal: "center" };

    //Adding Header Row
    let headerRow = worksheet.addRow(header);
    headerRow.eachCell((cell, number) => {
      cell.fill = {
        type: "pattern",
        pattern: "solid",
        fgColor: { argb: "4167B8" },
        bgColor: { argb: "" },
      };
      cell.font = {
        bold: true,
        color: { argb: "FFFFFF" },
        //text :'capitalize',
        size: 12,
      };
    });

    // Date
    worksheet.mergeCells("G2:H2");
    let d = new Date();
    let n = d.toLocaleDateString();
    let date = " Date: " + n;
    let dateCell = worksheet.getCell("G2");
    dateCell.value = date;
    dateCell.font = {
      name: "Calibri",
      size: 12,
      bold: true,
    };
    dateCell.alignment = { vertical: "middle", horizontal: "center" };

    var imgBase64 = "";
    "data:image/png;base64,";
    // } else {
    imgBase64 =
      "data:image/png;base64,";
    // }
    //Add Image
    let myLogoImage = workbook.addImage({
      base64: imgBase64,
      extension: "png",
    });
    worksheet.mergeCells("B1:A4");
    let imgCell = worksheet.getCell("B1:C4");
    imgCell.alignment = { vertical: "middle", horizontal: "center" };
    worksheet.addImage(myLogoImage, "B1:A4");

    //Blank Row

    worksheet.addRow([]);
    //Adding Data with Conditional Formatting
    data.forEach((d) => {
      let row = worksheet.addRow(d);
    });

    worksheet.getColumn(1).width = 20;
    worksheet.getColumn(2).width = 20;
    worksheet.getColumn(3).width = 20;
    worksheet.getColumn(4).width = 20;
    worksheet.getColumn(5).width = 20;
    worksheet.getColumn(6).width = 20;
    worksheet.getColumn(7).width = 20;
    worksheet.getColumn(8).width = 20;
    worksheet.getColumn(9).width = 20;
    worksheet.getColumn(10).width = 20;
    worksheet.getColumn(11).width = 20;
    worksheet.getColumn(12).width = 20;

    worksheet.addRow([]);

    //Generate & Save Excel File
    workbook.xlsx.writeBuffer().then((data) => {
      let blob = new Blob([data], {
        type: "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet",
      });
      fs.saveAs(blob, title + ".xlsx");
    });
  }
}
